import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Wait for product cards to be rendered by the script
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const initialCartText = await page.locator('div.cart').textContent();

    // --- Rapidly add items to the cart ---
    const addToCartButtons = await page.locator('.add-to-cart').all();
    const addClicks = [];
    // Click the first 5 "Add to Cart" buttons
    for (let i = 0; i < Math.min(addToCartButtons.length, 5); i++) {
        addClicks.push(addToCartButtons[i].click());
    }
    await Promise.all(addClicks);

    // Wait for the cart counter to update
    await page.waitForSelector('div.cart:has-text("5")', { timeout: 5000 });
    const cartTextAfterAdd = await page.locator('div.cart').textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_adding_items.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_adding_items.png'));

    // --- Open the cart and verify items ---
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    const itemsInCartCount = await page.locator('.cart-item').count();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // --- Rapidly remove items from the cart ---
    const removeButtons = await page.locator('.remove-item').all();
    const removeClicks = removeButtons.map(button => button.click());
    await Promise.all(removeClicks);

    // Wait for the cart to show it's empty
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    const finalCartMessage = await page.locator('.empty-cart').textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_empty.png'));

    const cartTextAfterRemove = await page.locator('div.cart').textContent();

    // Close the cart modal to finish
    await page.locator('span.close').first().click();

    return {
      success: true,
      action: "Rapidly added 5 items to the cart, verified them, then rapidly removed them all.",
      extractedData: {
        initialCartText: initialCartText.trim(),
        cartTextAfterAdd: cartTextAfterAdd.trim(),
        itemsInCartCount,
        cartTextAfterRemove: cartTextAfterRemove.trim(),
        finalCartMessage: finalCartMessage.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));
    return {
      success: false,
      action: "Failed to perform rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
